import React,{Component} from 'react';
import './Myheaderstyle.css';

class Myheader extends Component {

    constructor(props) {
        super(props);
    }
    
    render() {
        let color1={color:"#FE6256"}
        let color2={color:"#E61D2E"}
        let color3={color:"#1BB0B5"}
        let color4={color:"#4D5054"}
        return (
            <div>
                <div className="headertitle">国内疫情</div>
                <div className="Myheader">
                        <div className="header_element">
                            <div className="element_title">现有确诊</div>
                            <div className="element_tot" style={color1}>534</div>
                            <div className="element_new">昨日 <span style={color1}>+12</span></div>
                        </div>
                        <div className="header_element">
                            <div className="element_title">累计确诊</div>
                            <div className="element_tot" style={color2}>534</div>
                            <div className="element_new">昨日 <span style={color2}>+12</span></div>
                        </div>
                        <div className="header_element">
                            <div className="element_title">累计治愈</div>
                            <div className="element_tot" style={color3}>534</div>
                            <div className="element_new">昨日 <span style={color3}>+12</span></div>
                        </div>
                        <div className="header_element">
                            <div className="element_title">累计死亡</div>
                            <div className="element_tot" style={color4}>534</div>
                            <div className="element_new">昨日 <span style={color4}>+12</span></div>
                        </div>
                </div>
            </div>
        )
    }
}

export default Myheader;
